import React, { useState } from 'react';
import HamburgerMenu from './HamburgerMenu';
import MySettingsIcon from './small-components/MySettingsIcon';

const NavigationBar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuClick = () => {
    setIsMenuOpen(!isMenuOpen);
  }

  const handleCloseMenu = () => {
    setIsMenuOpen(false);
  }

  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#F8F8F8', padding: '10px' }}>
      <div style={{ fontSize: '24px', fontWeight: 'bold' }}>
        Logo
      </div>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <MySettingsIcon />
        <div style={{ marginLeft: '20px' }} onClick={handleMenuClick}>
          <div style={{ width: '30px', height: '3px', backgroundColor: '#333', marginBottom: '5px' }}></div>
          <div style={{ width: '30px', height: '3px', backgroundColor: '#333', marginBottom: '5px' }}></div>
          <div style={{ width: '30px', height: '3px', backgroundColor: '#333' }}></div>
        </div>
      </div>
      <HamburgerMenu isOpen={isMenuOpen} handleClose={handleCloseMenu} />
    </div>
  );
};

export default NavigationBar;
